//@ts-nocheck
import Grid from '@material-ui/core/Grid';
//import Paper from '@material-ui/core/Paper';
import React from 'react';
import {Col, Panel, Row} from 'rsuite';
import RadarChartV from './RadarChart';

type cardprops = {
  RadarChartData?:any
  cardData?:any;

};

const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{width:'80%', backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);

const LastCardV = (props: cardprops) => {
  const _getCards = () => {
    const _tempData: any = [];
    // eslint-disable-next-line no-unused-expressions
    Array.isArray(props?.cardData) &&
      props?.cardData.forEach(item => {
        const i = 0;
        _tempData.push(
          <Grid item xs={12} sm={6} md={3}>
           <Row>
           <Col md={props?.RadarChartData?.md} sm={props?.RadarChartData?.sm}>
      <Card  ><div style={{height:"500px"}}>
  <RadarChartV RadarChartData={props?.RadarChartData}/>

        </div></Card>
    </Col>
           </Row>
          </Grid>,
        );
      });
    return _tempData;
  };
  return (
    <Grid container justify={'center'} alignItems={'center'}>
      <Grid container spacing={3} style={{background: '#eeee'}}>
        {_getCards()}
      </Grid>
    </Grid>
  );
};
export default LastCardV;
